function getAnswer(){
	gs.info('WF - WF Action = ' + current.wf_action);
	gs.info('WF - FO State = ' + current.facility_order.state);
	if(current.wf_action == 'rework' || current.wf_action == 'complete' || current.wf_action == 'back_to_administration' || current.wf_action == 'terminated'){
		return true;
	} else {
		return false;
	}
}

// Set the variable 'answer' to true or false to indicate if the condition has been met or not.
answer = getAnswer();

