var grFacilityOrder = new GlideRecord('x_lsmcb_fm_facility_order');
if(grFacilityOrder.get(current.facility_order + '')){
	gs.info('trying to nudge FO (approval): ' + current.facility_order.number);
	var wf = new global.Workflow();
	wf.runFlows(grFacilityOrder, 'update');
	gs.info('successfully nudged FO (approval): ' + current.facility_order.number);
}

