var grItemReservation = new GlideRecord('x_lsmcb_fm_item_reservation');
grItemReservation.addQuery('facility_suborder', current.sys_id);
grItemReservation.query();
while(grItemReservation.next()) {
	grItemReservation.setValue('state', '2');
	grItemReservation.update();
}

